  `Medal_id` int AUTO_INCREMENT,
  `Medal_type` text,
  `Medal_code` int DEFAULT NULL,
  `Athlete_short_name` text,
  `Athlete_id` int,  
  `Name` VARCHAR(255),
  `Athlete_sex` text,
  `Event_stage` VARCHAR(255),
  `Event_id` int,
  `Country` text,
  `Country_code` VARCHAR(10),
  
