    ON DELETE SET NULL
    ON UPDATE CASCADE,
  FOREIGN KEY (Event_id)
	REFERENCES events_ (Event_id)
    ON DELETE SET NULL
    ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
